import React from 'react';
import './Person.css';

const names = ["Niv", "Prague", "Dana", "Amit", "Gal", "Roy"];
const person = () => {
    return (
      <div className="person-wrapper">
          <h1>My name is {names[Math.floor(Math.random() * names.length)]}</h1>
      </div>
    );
};

export default person;
